export default function UpperBody() {
    let upperbodyStyle = {
        position: "absolute",
        // top: '15rem',
        // display: 'flex',
        background:"red",
        top:"10rem",
        width: "100%",
        height: '30%'
}
    return(
        <div style={upperbodyStyle}>
            <h1>UpperBody</h1>
        </div>
    )
}
